import React, { useState, useEffect } from 'react';
import { getData } from '../api/endpoint';

const PatientsList = () => {
  const [patients, setPatients] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    const fetchPatients = async () => {
      try {
        setLoading(true);
        const data = await getData('/patients');
        setPatients(Array.isArray(data) ? data : []);
      } catch (err) {
        console.error('Patients error:', err);
        setPatients([]);
      } finally {
        setLoading(false);
      }
    };

    fetchPatients();
    // Refresh toutes les 30s
    const interval = setInterval(fetchPatients, 30000);
    return () => clearInterval(interval);
  }, []);

  if (loading) {
    return (
      <div style={{ padding: '4rem', textAlign: 'center' }}>
        <div style={{ fontSize: '3rem', marginBottom: '1rem' }}>ðŸ”„</div>
        <h3>Chargement patients en temps rÃ©el...</h3>
      </div>
    );
  }

  return (
    <div>
      <div style={{ 
        padding: '2rem 3rem 1.5rem', 
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        color: 'white', marginBottom: '0'
      }}>
        <h2 style={{ margin: 0, fontSize: '2rem' }}>ðŸ‘¥ Patients</h2>
        <p style={{ margin: '0.5rem 0 0', opacity: 0.9 }}>
          {patients.length} patient(s) â€¢ Mise Ã  jour: {new Date().toLocaleTimeString('fr-FR')}
        </p>
      </div>
      
      {patients.length === 0 ? (
        <div style={{ padding: '4rem', textAlign: 'center', color: '#999' }}>
          <div style={{ fontSize: '4rem', marginBottom: '1rem' }}>ðŸ‘¤</div>
          <h3>Aucun patient</h3>
          <p>Les nouveaux patients apparaÃ®tront ici en temps rÃ©el</p>
        </div>
      ) : (
        <div style={{ maxHeight: '600px', overflowY: 'auto' }}>
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ background: '#f8f9fa' }}>
                <th style={{ padding: '1.5rem 1rem', textAlign: 'left', fontWeight: '600' }}>Nom</th>
                <th style={{ padding: '1.5rem 1rem', textAlign: 'left', fontWeight: '600' }}>Email</th>
                <th style={{ padding: '1.5rem 1rem', textAlign: 'left', fontWeight: '600' }}>TÃ©lÃ©phone</th>
                <th style={{ padding: '1.5rem 1rem', textAlign: 'left', fontWeight: '600' }}>Sexe</th>
                <th style={{ padding: '1.5rem 1rem', textAlign: 'left', fontWeight: '600' }}>CrÃ©Ã© le</th>
              </tr>
            </thead>
            <tbody>
              {patients.map(patient => (
                <tr key={patient._id} style={{ borderBottom: '1px solid #eee', transition: 'background 0.2s' }}
                    onMouseEnter={(e) => e.target.style.background = '#f5f5f5'}
                    onMouseLeave={(e) => e.target.style.background = 'white'}
                >
                  <td style={{ padding: '1.5rem 1rem', fontWeight: '600', color: '#1976d2' }}>
                    {patient.fullName || patient.nom || 'N/A'}
                  </td>
                  <td style={{ padding: '1.5rem 1rem' }}>
                    <a href={`mailto:${patient.email}`} style={{ color: '#2196f3', textDecoration: 'none' }}>
                      {patient.email}
                    </a>
                  </td>
                  <td style={{ padding: '1.5rem 1rem' }}>{patient.telephone || 'N/A'}</td>
                  <td style={{ padding: '1.5rem 1rem' }}>
                    <span style={{ 
                      background: patient.sexe === 'M' ? '#e3f2fd' : '#fce4ec', 
                      padding: '0.3rem 0.8rem', borderRadius: '20px', fontSize: '0.9rem' 
                    }}>
                      {patient.sexe === 'M' ? 'â™‚ Masculin' : 'â™€ FÃ©minin'}
                    </span>
                  </td>
                  <td style={{ padding: '1.5rem 1rem', color: '#666' }}>
                    {patient.createdAt ? new Date(patient.createdAt).toLocaleDateString('fr-FR') : 'N/A'}
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
};

export default PatientsList;
